пос. городского типа Тлюстенхабль, Теучежский район, республика Адыгея
Закупка макулатуры и полимерных отходов ООО "Вектор" (чтобы найти адрес, позвоните тел. +7 (861) 299-72-35, +7 (989) 275-90-90)
Принимают:
- гофрированный картон (5Б/2);
- архив (7Б/1) сортированный - сортированные отходы производства белой бумаги (кроме газетной) в виде обрезков с линовкой и чёрно-белой или цветной полосой;
- книги, пр-ты, газеты, каталоги, блокноты, тетради, записные книжки (7Б/4) и др. виды продукции полиграфической промышленности и бумажных товаров с однокрасочной и цветной печатью без преплётов и корешков, изданные на белой бумаге;
- отходы мелованной или офсетной бумаги (кроме газетной) 7Б/2;
- смесь всех марок 13В (кроме влагостойких);
- полипропелен (PP) - использованный овощной ящик, лом овощного ящика;
- ПВД/стретч - отходы ПВД/стрейч плёнки, гладкие нешуршащие пакеты, пищевая плёнка, парниковая плёнка, упаковочная плёнка;
- ПPET (01) - использованная тара пластиковой бутылки, брак производства пластиковой бутылки, преформа под пластиковую бутылку.
